<template>
    <v-navigation-drawer
        permanent
    >
        <filesystem
            :groups="groups"
            @select="selectAnalysis"
            @select:clear="clearSelectedAnalysis"

            @sample:add="addSample"
            @sample:update="updateSample"
            @sample:remove="removeSample"
            @group:update="updateGroup"
            @group:remove="removeGroup"
        />

        <template #append>
            <div class="d-flex justify-center pa-3">
                <v-btn
                    color="primary"
                    prepend-icon="mdi-plus"
                    text="Create group"
                    @click="createGroup(`New group ${newGroupsAddedCounter++}`)"
                />
            </div>
        </template>
    </v-navigation-drawer>

    <v-container fluid>
        <v-layout>
            <v-main min-height="400">
                <analysis-summary-progress v-if="selectedAnalysis && !selectedAnalysisFinished" />
                <analysis-summary
                    v-else-if="selectedAnalysis && selectedAnalysisFinished"
                    :analysis="selectedAnalysis"
                    @update="console.log"
                />
            </v-main>
        </v-layout>

        <taxonomic-results
            v-if="selectedAnalysis && selectedAnalysisFinished"
            class="mt-5"
            :analysis="selectedAnalysis"
        />

        <functional-results
            v-if="selectedAnalysis && selectedAnalysisFinished"
            class="mt-5"
            :analysis="selectedAnalysis"
            @update-filter="updateFilter"
        />
    </v-container>
</template>

<script lang="ts">
export interface AnalysisGroup {
    name: string;
    analysis: Analysis[];
    open: boolean;
}

export interface Analysis {
    id: number;
    sample: Sample;
    config: AnalysisConfig;
    result: AnalysisResult;
}

export interface Sample {
    name: string;
    rawPeptides: string;
}

export interface AnalysisConfig {
    equate: boolean;
    filter: boolean;
    missed: boolean;
    database: string;
}

export interface AnalysisResult {
    status: AnalysisStatus;
    config: AnalysisConfig;
}

export enum AnalysisStatus {
    Pending,
    Running,
    Finished
}
</script>

<script setup lang="ts">
